import React from 'react'
import { StyleSheet, Text, View } from 'react-native'
import { Button } from 'react-native-elements'

interface ContainerInputs{
    title: string, 
    description: string, 
    buttonTitle?:string, 
    buttonPressed?: () => void
}

const SubscribePlan = () => {



    const container = (input: ContainerInputs) => {
      return(
          <>
          <Text style={styles.titleFont}>{input.title}</Text>
          <View style={styles.rowContainer}>
              <Text>
                  {input.description}
              </Text>
              <Button containerStyle={styles.Tag} type="clear" title={input.buttonTitle} onPress={input.buttonPressed} titleStyle={styles.buttonFont}/>
          </View>
          </>
      )
    }


    return (
        <View>
            {container({title:"사용중인 요금제", description:"프리미엄 요금제", buttonTitle:"구독취소", buttonPressed:()=>{}})}
        </View>
    )
}

export default SubscribePlan

const styles = StyleSheet.create({
    titleFont:{
        fontWeight:'700',
        fontSize:14,
        lineHeight:24,
        color:"#979797",
        textAlign:'left'
    },
    rowContainer:{
        flexDirection:'row',
    },
    Tag:{
        marginHorizontal:5,
        borderRadius: 20,
        borderColor:"white",
        borderWidth:0.1
    },
    buttonFont:{
        fontSize:12,
        color:"black"
    }

})
